
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='2560' height='1440'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	
// #rect4-0
	ctx.beginPath();
	ctx.lineWidth = 1.472380;
	ctx.rect(0.000000, 0.000000, 2560.000000, 244.000000);
	ctx.fill();
	
// #rect4-0-7
	ctx.beginPath();
	ctx.lineWidth = 3.259800;
	ctx.rect(0.000000, 244.000000, 2560.000000, 1196.000000);
	ctx.fill();
	
// #rect1-9-3
	ctx.beginPath();
	ctx.fillStyle = 'rgb(21, 11, 34)';
	ctx.lineWidth = 0.991102;
	ctx.strokeStyle = 'rgb(182, 150, 250)';
	ctx.rect(442.666660, 144.000000, 170.666670, 64.000000);
	ctx.fill();
	ctx.stroke();
	
// #text1
	ctx.fillStyle = 'rgb(255, 255, 255)';
	ctx.lineWidth = 1.001570;
	ctx.font = "66.6667px 'Monaspace Krypton Var'";
	ctx.fillText("smudgy", 40.333328, 99.000031);
	
// #rect1
	ctx.beginPath();
	ctx.fillStyle = 'rgb(255, 255, 255)';
	ctx.lineWidth = 0.991102;
	ctx.rect(48.000000, 144.000000, 170.666670, 64.000000);
	ctx.fill();
	
// #rect1-9
	ctx.beginPath();
	ctx.fillStyle = 'rgb(21, 11, 34)';
	ctx.lineWidth = 0.991000;
	ctx.strokeStyle = 'rgb(182, 150, 250)';
	ctx.rect(245.333330, 144.000000, 170.666670, 64.000000);
	ctx.fill();
	ctx.stroke();
	
// #text2
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, 22.000000, -100.000000);
	ctx.fillStyle = 'rgb(21, 11, 34)';
	ctx.lineWidth = 0.991000;
	ctx.font = "24px 'Monaspace Krypton Var'";
	ctx.fillText("None", 63.525391, 284.586640);
	ctx.restore();
	
// #text2-4
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, 199.244000, -100.851000);
	ctx.fillStyle = 'rgb(21, 11, 34)';
	ctx.lineWidth = 0.991000;
	ctx.font = "24px 'Monaspace Krypton Var'";
	ctx.fillText("None", 63.525391, 284.586640);
	ctx.restore();
	
// #text2-4-6
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, 405.411000, -100.473000);
	ctx.fillStyle = 'rgb(21, 156, 34)';
	ctx.lineWidth = 0.991000;
	ctx.font = "24px 'Monaspace Krypton Var'";
	ctx.fillText("None", 63.525391, 284.586640);
	ctx.restore();
	
// #rect4
	ctx.beginPath();
	ctx.lineWidth = 0.188519;
	ctx.rect(0.000000, 244.000000, 2560.000000, 4.000000);
	ctx.fill();

    </script>
</body>
</html>
